import { fetchApiAuth } from "../utils/api"

interface Startup {
    static_id: string
    name: string
    domain: string
    valuation: number
}

interface StartupCardProps {
    startup: Startup
}


function StartupCard({startup}:StartupCardProps) {
    return (
        <a className="rounded-lg border border-black p-2 text-md text-black flex flex-col hover:shadow-lg hover:scale-105 hover:bg-[#181C14] transition duration-300 hover:text-[#ECDFCC] " href={`/student/${startup.static_id}`}>
            <p className="text-center font-bold tracking-[.1rem] font-sans capitalize">
                {startup.name}
            </p>
            <p className="text-[.9rem]">
                Domain: {startup.domain}
            </p>
            <p>
                Valuation: {startup.valuation}
            </p>
        </a>
    );
}

async function Startups(){
    const res = await fetchApiAuth("startups/list/",{
        method:"GET",
        cache:"no-cache"
    })

    const startups = await res.json()

    return (

        <div className="flex flex-col gap-6">
            <p className="font-bold text-center text-[2.5rem]">
                Startups
            </p>
            <div className="w-full grid md:grid-cols-3 grid-cols-1 gap-3 h-full">
            
                {
                    startups.slice(0,9).map((startup)=><StartupCard startup={startup}></StartupCard>)
                }
                {
                    startups.length > 9 ? <a className="text-blue-600 hover:underline" href="/startups">View all</a> : <></>
                }
            </div>
        </div>

        
    );
}



function ApplicationCard({application}:any) {
    return (
        <div className="rounded-lg border border-[#ECDFCC] hover:bg-[#ECDFCC] hover:text-[#181C14] transition duration-300 p-2 text-md text-[#ECDFCC] flex flex-col">
            <p className="text-center font-bold">
                {application.job.startup}
            </p>
            <div className="flex flex-row justify-between">
                <p>
                    Job: {application.job.title}
                </p>
                <a href={application.resume} target="_blank" className="text-[#181C14] bg-[#ECDFCC] py-[.2rem] px-[1.5rem]  hover:text-[#ECDFCC] hover:bg-[#181C14] rounded-[1rem]">Resume</a>
            </div>
            <img className="z-[-1] absolute bottom-[50px] right-[25rem] w-[400px]" src="data:image/png;base64,"></img>
        </div>
    );
}

async function Applications(){
    
    const res = await fetchApiAuth("startups/applications/",{
        method:"GET",
        cache:"no-cache"
    })

    const applications = await res.json()
    console.log(applications)

    return (
        <div className="w-ful text-[#ECDFCC] bg-[#181C14] flex flex-col gap-3 h-full ">
            <p className="font-bold text-center text-[2rem]">
                Applications
            </p>
            <div className="overflow-y-scroll p-3 flex flex-col gap-2 border borcer-black">
                {
                    applications.map((application)=><ApplicationCard application={application}/>)
                }
            </div>
        </div>
    );
}

export default function Page(){
    return(
        <div className="flex flex-row w-full h-full">
            <div className="w-2/3 border border-r-indigo-400 p-4 h-full">
                <Startups/>
            </div>
            <div className="w-1/3 border border-r-indigo-400 p-4 h-full">
                <Applications/>
            </div>
        </div>
        
        
    );
}